script: |
  super -f text -I q4262.spq | sort > q4262.out

inputs:
  - name: q4262.spq
    data: |
      SELECT DISTINCT - col2 FROM tab2 (FORMAT parquet) WHERE NOT + + col2 IN ( - 5 - - + col1 * - - col1 * col1, ( + - 33 ) );
  - name: tab2

outputs:
  - name: q4262.out
    data: |
      -23
      -40
      -58
